import React from 'react';

const Form = props => (

    <form onSubmit={props.getFilm} style={{ margingBottom: "2rem" }}>
        <input className="form__input" type="text" name="filmName" />

        <button clasName="form__buttons">Search</button>
    </form>
);

export default Form;
